import { Fragment } from "react";

const Nav = () => {
  return (
    <div className="nav-bar">
      <ul>
        <li>Sneakers</li> <li>Collections</li> <li>Men</li> <li>Women</li>{" "}
        <li>About</li> <li>Contact</li>
      </ul>
    </div>
  );
};

export default Nav;
